import React from 'react';

const TopComponent = () => {
  return (
    <div className='TopList'>
      <li> Rank </li>
      <li> Name </li>
      <li> Games </li>
      <li> Victories </li>
      <li> Winrate </li>
      <li> Status </li>   

    <ul>
    <li><a href="#home">Home</a></li>
    <li><a href="#news">News</a></li>
    <li><a href="#contact">Contact</a></li>
    <li><a href="#about">About</a></li>
  </ul>
  </div>
  );
};

export default TopComponent;
